import 'semantic-ui/dist/semantic.min.css';
import '../Managerpg2/Managermain2.css'
import Empheader from './empheader'
import ManagerNav from "../Managerpg1/ManagerNav";
import ManagerFooter from "../Managerpg1/ManagerFooter";
import {BrowserRouter,Redirect} from "react-router-dom";
import employee from '../images/employee.png'
//import Managermain3 from "../Managerpg3/Managermain3"
import { Form, TextArea,Button,Segment,Label,Icon } from 'semantic-ui-react';
import axios from 'axios'
import apiconstants from './config';

class Empmain1 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        data1:'',
        month:'',
        redirect1: false,
        }
    }


   setRedirect1 =(e) => {
        this.setState({
            redirect1: true
        })   
    }  


    componentDidMount = () => {
        this.profile(); 
    }

    profile() {
        let id = this.props.match.params.id
        console.log(id)
        fetch(apiconstants.URL +`profile/${id}`, {
            method: 'GET',
            headers: {
                'content-Type': 'application/json',
                'Accept': 'application/json',
            },
        })
        .then(res => res.json())

            .then(res => {
                this.setState({ data1: res });
               })

            }



    render() {


            const  {data1}  = this.state;
            {
            if (this.state.redirect1) {
            let id=this.props.match.params.id

            return <Redirect to={"/em-month"+"/"+ this.props.match.params.id+ "/"+ data1.empname}/>; 
            }
            }



        return (
            <div className="manbg">
                <Empheader idd={this.props.match.params.id} />
                <br/>
                <br/>
                <br/>
                <div style={{color:"black"}}>
        <div className="profiletab" >
        <img style={{width:"50px"}} src={employee}/>
      &nbsp; &nbsp;
        {data1.empname}<br/>
        {data1.email}
         </div>
                </div>
                <br/> <br/><br/>
                <h1 style={{color:"black"}}  className="ui" >  
                </h1>
                <br/>
                <br/>

<br/>
<BrowserRouter>
 <nav>
<div className="ui">
<Button onClick={this.setRedirect1} 
style={{width:"300px",margin:"40px",padding:"30px"}}  
className="ui blue large button" ><Icon name="wpforms"/> FEEDBACK & <Icon name="target"/>GOALS</Button>
</div>


    </nav>
</BrowserRouter>
                <br/>
                <br/>
                <br/>
<ManagerFooter/>
        </div>
        )
    }
}

        export default Empmain1
